import IconButton from '@material-ui/core/IconButton';

class Header extends Component {
    render() {
        return (
          <AppBar
              position={"fixed"} style={{backgroundColor:"#2f2f2f",padding:"10px"}}
          >
              <Toolbar>
                  <div className={header_logo}>

                  </div>
              </Toolbar>
          </AppBar>
        );
    }
}

export default Header;
